import React from "react";
function Univers() {
  return (
    <div className="container py-5">
      <h2 className="fw-bold mb-4">Our Technology Stack</h2>
      <p className="text-muted mb-4">
        We leverage cutting-edge technologies to deliver a seamless trading experience.
      </p>
      <ul className="list-unstyled">
        <li>React for building user interfaces</li>
        <li>Node.js for server-side logic</li>
        <li>GraphQL for efficient data fetching</li>
        <li>Docker for containerization</li>
        <li>AWS for cloud infrastructure</li>
      </ul>
    </div>
  );
}
export default Univers;
